import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    console.log("Component logging");
    const a = 10;
    const b = 16;
    const now = new Date();
    return (
        <div>
            <p>Hello world, I enjoy {now.toLocaleTimeString}</p>
            <p>a is {a}, and b {b}.</p>
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
